import React, { useState } from 'react'
import {Row, Col, Container} from 'react-bootstrap'

export default function Home() {
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");

    function handleSubmit (event) {
        fetch("/find_name/" + firstName)
            .then((response) => response.json())
            .then((data) => {
              setLastName(data.lastName);
            })
            .catch((error) => {
              console.log(error);
            });
    }


    return (
        <Container>
             <Row style={{justifyContent: "center", margin: 0}}>
                 <Col style={{maxWidth: "fit-content", margin: 0}}>
                 Your Input <br />
                 Request to Server
                     <form onSubmit={this.handleSubmit}>
                             <input type="name" value={this.state.value} onChange={this.handleChange} name="name" placeholder="Enter name"/>
                     </form>
                 </Col>
                 <Col style={{maxWidth: "fit-content", margin: 0}}>
                 <br />
                 Response from Server<br />
                     <input type="ans" value={lastName} name="ans"/>
                 </Col>
             </Row>
        </Container>
    );
}


